def testCaseProps = testRunner.testCase.getProperties( )
def countMasterPolicies = 0
for (prop in testCaseProps.values()) {
	if (prop.getName().startsWith("uuid")) {
		testRunner.testCase.setPropertyValue( prop.getName(), UUID.randomUUID( ).toString( ) )
		countMasterPolicies++
	}
}

testRunner.testCase.setPropertyValue("UUID_1", context.expand( '${=java.util.UUID.randomUUID()}' ) )
testRunner.testCase.setPropertyValue("UUID_2", context.expand( '${=java.util.UUID.randomUUID()}' ) )
def numOfUUIDs = 2

for ( i = 1 ; i <= numOfUUIDs ; i++ ) {
	testRunner.testCase.setPropertyValue("UUID_"+i, UUID.randomUUID().toString().toUpperCase() )
}

for ( i = 1 ; i <= numOfUUIDs ; i++ ) {
	testRunner.testCase.setPropertyValue("UUID_"+i+"_ECH", testRunner.testCase.getPropertyValue("UUID_"+i).replace('-','') )
}
